import "../styles/Header.css";

const Header = () => {
  return (
    <div className={`head-container`}>
      <div className={`logo head`}></div>
      <div className={`title head`}>ATL Brew</div>
      <div className={`browse head`}>Browse</div>
      <div className={`top-ten head`}>Top Picks</div>
      <div className={`sign-up head`}>Sign Up</div>
      <div className={`sign-in head`}>Sign In</div>
      <div className={`nav-icon-container`}>
        <div className={`nav-icon`}></div>
      </div>
    </div>
  );
};

export default Header;
